import ReactDOM from "react-dom";
const date = new Date();
const currentTime = date.getHours();

let greeting;
if (currentTime < 12) {
  greeting = "good morning";
} else if (currentTime < 18) {
  greeting = "good afternoon";
} else {
  greeting = "good night";
